INSERT INTO `AntiFrieze`.`letterlist`(`LIndex`, `LetterNum`, `ShortDesc`, `LongDesc`, `AddFactor`, `MgrID`)
VALUES (1, 1, 'Thank-You', 'Thank you for recently having your vehicle serviced at our repair facility.\r\n\r\nWhile you were here, we put your vehicle\'s \"vital statistics\" into our computer.  We will maintain a complete record of all repairs and maintenance for you.\r\n\r\nWe do this so we can provide the best possible service for you.  Our technicians are highly skilled in all aspects of automobile repair. We utilize the latest tools and equipment to help maintain your vehicle.\r\n\r\nWe appreciate your business.  If there is anything we can do for you in the future please do not hesitate to let us know.  We hope you will call on us for all of your service needs.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 0, 1),
  (2, 2, 'Spring', 'With the warm weather arriving, many of us will take to the highways for trips and vacations.  Make sure that a breakdown doesn\'t interrupt your plans.\r\n\r\nOver time, your vehicle\'s coolant can become contaminated, weak and ineffective.  In addition to the obvious inconvenience of a breakdown, overheating can cause serious damage to your vehicle\'s engine, resulting in costly repairs.\r\n\r\nSo, before heading out on your vacation, call us for an appointment.  Our technicians will power flush your cooling system, replace the coolant and inspect the radiator, belts and hoses.  We\'ll even test your air conditioner\'s operation for free.\r\n\r\nWe appreciate your continued confidence in our repair facility and look forward to hearing from you soon.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 365, 1),
  (3, 3, 'Summer', 'Summertime is almost here.  Now is the time to have your automotive air conditioning inspected and tested.  Let our experienced A/C technicians check out your vehicle\'s air conditioning system.  It has been our experience that finding small potential problems now, can save you money and hot days behind the wheel.\r\n\r\nSchedule your next appointment for a complete checkout.  We will inspect your system, test the overall A/C performance and check for any refrigerant leaks. We will also notify you of any potential problems and do any necessary service.\r\n\r\nAs always, we appreciate your business and the opportunity to serve you.  We hope you will call on us for all of your service needs.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 365, 1),
  (4, 4, 'Winter', 'Winter is almost upon us!  You may be ready, but is your vehicle?\r\n\r\nIf your answer to this question is \"no\" or \"maybe\", let us help you get ready.\r\n\r\nHere\'s what we\'ll do to get your vehicle ready for winter:\r\n\r\n- Power flush your radiator and cooling system.\r\n- Replace coolant to the specified levels with the proper mixture of anti-freeze.\r\n- Tune up your engine.\r\n- Check your charging system and top off your battery.\r\n- Top off your windshield washer fluid.\r\n- Check all hoses and belts.\r\n- Install your snow chains or tires.\r\n\r\nSo call us today for an appointment...and don\'t let winter leave you and your vehicle out in the cold.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 365, 1),
  (5, 5, 'Fall', 'Cooler weather is coming.  It\'s a good time to have your vehicle inspected before trouble occurs.\r\n\r\nYour tires should be inspected & rotated every 5,000 - 8,000 miles. For your safety, we can inspect your brakes while we rotate your tires.  We will also check the condition of your belts and hoses.\r\n\r\nImportant to know:\r\n\r\n- Tire wear:  Worn tread in a tire could be an indication of other areas of concern for your vehicle, such as wheel alignment problems, worn suspension parts, or improper wheel balance.\r\n\r\n- Air pressure:  Having the proper air pressure in your tires is a major factor in preventing premature tire wear and failure. Low tire pressure will cause your vehicle to burn more fuel. Proper air pressure in your tires saves on fuel and money.\r\n\r\nCall today for an appointment so we can service your vehicle and ensure you have a safe, smooth and comfortable ride.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 365, 1);

