INSERT INTO `AntiFrieze`.`Reminders`(`RemindId`, `Title`, `LongDesc`, `Type`, `CarId`, `CusId`, `RemindNum`, `Created`, `SetDate`, `Completed`, `AddFactor`, `MgrID`, `BatchName`)
VALUES (1, 'Brakes', 'The importance of having reliable brakes on your vehicle cannot be overstated. It is important to make brakes a part of your vehicle\'s routine service schedule for you and your family\'s safety. \r\n\r\nAccording to the National Car Care Council, wheels should be pulled and brakes inspected once a year.  Brake systems should be flushed and brake fluid replaced every two years. Depending on your vehicle and how you drive, brakes should usually be replaced every 25,000 to 40,000 miles.\r\n\r\nGive us a call to schedule an appointment to have your brakes inspected.  Don’t take any chances with worn, unreliable brakes.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 'Reminder', 27, 28, 3, '2009-06-11 00:00:00', '2009-07-07 00:00:00', NULL, 730, 1, NULL),
  (2, 'Brakes', 'The importance of having reliable brakes on your vehicle cannot be overstated. It is important to make brakes a part of your vehicle\'s routine service schedule for you and your family\'s safety. \r\n\r\nAccording to the National Car Care Council, wheels should be pulled and brakes inspected once a year.  Brake systems should be flushed and brake fluid replaced every two years. Depending on your vehicle and how you drive, brakes should usually be replaced every 25,000 to 40,000 miles.\r\n\r\nGive us a call to schedule an appointment to have your brakes inspected.  Don’t take any chances with worn, unreliable brakes.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 'Reminder', 85, 87, 3, '2009-07-06 00:00:00', '2011-07-06 00:00:00', NULL, 730, 1, NULL);

INSERT INTO `AntiFrieze`.`Remindlist`(`RIndex`, `RemindNum`, `ShortDesc`, `LongDesc`, `AddFactor`, `MgrID`)
VALUES (1, 1, 'Alignment / Suspension', 'Remember that nice solid feeling that your vehicle had when it was new?  Didn\'t it also give you a feeling of security and control?\r\n\r\nYour vehicle\'s steering and suspension systems play a major part in its handling characteristics: how it feels on the road and how it manueuvers you out of an emergency. A responsive vehicle, one that holds the road under adverse conditions, can make the  difference between a frightening close call and a serious accident. You should have your alignment checked at least once a year, or sooner if your vehicle pulls or seems to wander.\r\n\r\nResponsiveness is an important safety factor. It reduces driver fatigue and enhances the enjoyment of driving.\r\n\r\nCall us today to schedule a thorough inspection of your vehicle\'s steering and suspension. We appreciate your continued confidence in our repair facility.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 330, 1),
  (2, 2, 'Belts - Hoses', 'A recent survey by the National Car Care Council found that almost 25% of vehicles on the road need new belts or hoses.  Most manufacturers recommend that these maintenance items be replaced every three or four years.\r\n\r\nExtreme hot and cold temperature changes throughout the year damage rubber components like belts and hoses.  Have your vehicle inspected soon to avoid a breakdown due to neglect.  Our automotive experts know what to look for.\r\n\r\nMake an appointment to have us perform a thorough check of all belts and hoses.  While your vehicle is here, we will also perform a free multi-point safety inspection. \r\n\r\nWe appreciate your continued confidence in our repair facility and look forward to hearing from you soon.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 910, 1),
  (3, 3, 'Brakes', 'The importance of having reliable brakes on your vehicle cannot be overstated. It is important to make brakes a part of your vehicle\'s routine service schedule for you and your family\'s safety. \r\n\r\nAccording to the National Car Care Council, wheels should be pulled and brakes inspected once a year.  Brake systems should be flushed and brake fluid replaced every two years. Depending on your vehicle and how you drive, brakes should usually be replaced every 25,000 to 40,000 miles.\r\n\r\nGive us a call to schedule an appointment to have your brakes inspected.  Don’t take any chances with worn, unreliable brakes.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 730, 1),
  (4, 4, 'Oil Service', 'Our records indicate that your vehicle is due for an oil change.\r\n\r\nOil is the life-blood of your vehicle’s engine.  Periodic oil and filter changes keep the inside of your engine clean.  Motor oil can become contaminated by dust, metallic shavings and condensation. Oil additives can break down over time and actually become contaminants. \r\n\r\nThe National Car Care Council advises that every 3,000 miles or 3 months is a good rule of thumb for oil and filter changes. \r\n\r\n A regular oil change can:               \r\n      - Reduce internal engine wear and corrosion.               \r\n      - Help your engine run cleaner.                            \r\n      - Provide better starting in cold weather.                 \r\n      - Reduce oil consumption.                                   \r\n      - Help your engine run quieter.                             \r\n\r\nPlease call us soon so that we can schedule your next oil change.  We appreciate your continued confidence in our repair facility.                                                                  \r\n                                                              \r\nThank you, in advance, for another chance to serve you.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 90, 1),
  (5, 5, 'Rotate Tires', 'A recent study by the National Car Care Council found that 54% of all vehicles have low tire pressure. This can be dangerous.  Maintaining proper tire pressure and rotating tires regularly, extends the life of your tires.  In addition, our technicians can spot uneven wear that may be the result of improper balance or alignment.\r\n\r\nCall us today to schedule an appointment to make sure that your tires are safe and dependable. We appreciate your business and look forward to keeping your vehicle in top operating condition for years to come. \r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 180, 1),
  (6, 6, 'State Inspections / Emissions', 'According to our records, your vehicle will soon require its annual Emissions Certification.  In our state, annual inspections and certifications are required for any vehicle that is operated on public roads.\r\n\r\nCall today and set up an appointment.  You will save time and keep your vehicle in compliance.\r\n\r\nWe promise to get you in and out as quickly as possible.  We can also do a quick safety check, just to make sure everything is in good working order.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 365, 1),
  (7, 7, 'Timing Belt', 'Most manufacturers consider the timing belt to be a maintenance item and recommend replacing it between 50-65,000 miles. Our records indicate that your vehicle may have mileage within that range.\r\n\r\nThe effects of temperature changes throughout the year will cause deterioration of rubber timing belts. Wear is continuous. It is a good idea to inspect belts between replacements.\r\n\r\nA broken timing belt, depending on the engine, can result in severe engine damage.  On an interference engine, poor performance, bent valves, and even piston damage can result from a broken timing belt. The cost of ignoring this maintenance item can be much greater than the obvious inconvenience of an unexpected breakdown.\r\n\r\nPlease consider making an appointment to have the belt replaced now to avoid problems in the future.  We look forward to hearing from you soon.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 1460, 1),
  (8, 8, 'Transmission Service', 'Our records indicate that your vehicle is due for transmission service.\r\n\r\nPeriodic transmission fluid and filter changes keep the inside of your transmission clean. Fluid can become contaminated by dust, metallic shavings and condensation. We want to help you keep your vehicle shifting smoothly.\r\n\r\nThe National Car Care Council advises that servicing your transmission every year is the best way to avoid future transmission trouble.\r\n\r\nA regular transmission service can:        \r\n      - Reduce internal transmission wear and corrosion.                \r\n      - Help your transmission run cleaner.                             \r\n      - Reduce transmission fluid consumption.                                   \r\n      - Help your transmission run quieter and cooler.                                                                 \r\n\r\nPlease call us soon so that we can schedule your next appointment.  We appreciate your continued confidence in our repair facility. Thank you, in advance, for another chance to serve you.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 1095, 1),
  (9, 9, 'Tune-up', 'Many people believe that their late-model vehicle never needs a tune-up. It is true that technology has made the traditional tune-up obsolete.  However, vehicles today still need regular maintenance.\r\n\r\nTune-ups have been replaced with the need for high-tech engine performance checks. Onboard computers now control functions that were once handled mechanically.\r\n\r\nOur repair facility has qualified, trained technicians and state-of-the-art equipment to service today’s sophisticated ignition and fuel systems.  Our computers can communicate with your vehicle to obtain trouble codes or other system information.  \r\n\r\nAccording to the Society of Automotive Engineers, a good rule of thumb for regular performance checks is every 18 months or 20,000 miles, whichever comes first.  This will assure that you get the best performance and gas mileage possible with the added benefit of preventing future problems.\r\n\r\nPlease give us a call to schedule an appointment.  We appreciate your continued confidence in our repair facility and look forward to keeping your vehicle in top operating condition for years to come.\r\n\r\n\r\nSincerely,\r\n\r\n\r\n\r\nService Manager', 545, 1);

